import NavBar from '../components/NavBar';
import '../styles/App.css';
import "../styles/Home.css";
import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Router,
  Routes,
} from "react-router-dom";

const router = createBrowserRouter([
  {
    path: "/",
    element: <Home />,
  }, {
    path: "/test",
    element: <h1>test</h1>,
  },
]);

function App() {
  return (
    <>
      <NavBar />
      <Routes>
        <Route path="/login" element={<Login />} />
    </Routes>
    </>
  );
}

export default App;
